import React, { useState } from 'react'

function HookCounter() {
    const [count, setCount] = useState(0)

    increamentCounter = () => {
        setCount(count + 1)
    }
    return (
        <div>
            <button onClick={increamentCounter}>Count {count}</button>
        </div>
    )
}

export default HookCounter
